    Link
} from "react-router-dom";


function App() {
  return (
    <Router>
        <div>
            <nav>
                <ul>
                    <li>
                        <Link to="/">Home</Link>
                    </li>
                    <li>
                        <Link to="/about">About</Link>
                    </li>
                    <li>
                        <Link to="/users">Users</Link>
                    </li>
                </ul>
            </nav>

            <Routes>
                <Route path="/about">
                    {/*<About />*/}
                </Route>
                <Route path="/users">
                    {/*<Users />*/}
                </Route>
                <Route path="/">
                    {/*<Home />*/}
                </Route>
            </Routes>
        </div>
    </Router>

  );


}

export default App;
